import React from "react";

import { FaTrash, FaEdit } from "react-icons/fa";

import axios from "axios";

import { Table, Thead, Tr, Th, Tbody, Td } from "../styles/Grid";

export const Grid = ({ clinicas }) => {
  // console.log(clinicas);

  return(
    <>
      <Table>
        <Thead>
          <Tr>
            <Th>Código</Th>
            <Th>Nome</Th>
            <Th>Endereço</Th>
            <Th onlyWeb>Telefone</Th>
            <Th>Email</Th>
            <Th></Th>
            <Th></Th>
          </Tr>
        </Thead>
        <Tbody>
          {clinicas.map((item, i) => {
              return(
                <Tr key={i}>
                  <Td >{item.CodCli}</Td>
                  <Td >{item.NomeCli}</Td>
                  <Td >{item.Endereco}</Td>
                  <Td  onlyWeb>{item.Telefone}</Td>
                  <Td >{item.Email}</Td>
                  <Td alighCenter >
                    <FaEdit/>
                  </Td>
                  <Td alighCenter >
                    <FaTrash/>
                  </Td>
                </Tr>
            );
          })}
        </Tbody>

      </Table>

    </>
  )
}
